import './App.css';
import NavBar from './components/navbar';
import React, {useEffect, useState} from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Product from './page/productpage';
import { getProducts} from './actions/products'
import { getSalesPerson } from './actions/salesperson';
import { useDispatch } from 'react-redux';
import EditProduct from './page/editproductpage';
import Salesperson from './page/salespersonpage';

const App = () => {
  const dispatch = useDispatch();

  useEffect(() => {
      dispatch(getProducts());
  }, [dispatch]);

    useEffect(() => {
    dispatch(getSalesPerson());
}, [dispatch]);



  return (
   <Router>
     <div className='bg-stone-900 min-h-screen'>
      <div>
        <NavBar />
      </div>

    <Routes>
      <Route path='/product' element={<Product/>}/>
      <Route path='/editproduct/:productId' element={<EditProduct/>}/>
      <Route path='/salesperson'element={<Salesperson/>}/>
    </Routes>
    </div>
   </Router>
  )
}

export default App;
